import { createApp } from 'vue';
import App from './App.vue';
import router from './router';
import '@/assets/css/TransportCompanyTable.scss'; 
import '@/assets/css/AppLayout.scss'; 

const app = createApp(App);
app.use(router);
app.mount('#app');
